import React from 'react';
import {Redirect} from 'react-router-dom';
import {FuseUtils} from '@fuse';
import {ExampleConfig} from 'app/main/example/ExampleConfig';
import {RegisterConfig} from "../main/register/RegisterConfig";
import {LogoutConfig} from "../main/logout/LogoutConfig";
import {LoginConfig} from "../main/login/LoginConfig";
import {CategoryConfig} from "../main/department/ECommerceAppConfig";
import {SalleConfig} from "../main/salle/ECommerceAppConfig";
import {EvenementsConfig} from "../main/evenements/ECommerceAppConfig";
import {EventsConfig} from "../main/evenementUser/ECommerceAppConfig";

const routeConfigs = [
    ExampleConfig,
    RegisterConfig,
    LogoutConfig,
    LoginConfig,
    CategoryConfig,
    SalleConfig,
    EvenementsConfig,
    EventsConfig
];

const routes = [
    ...FuseUtils.generateRoutesFromConfigs(routeConfigs),
    {
        path     : '/',
        component: () => <Redirect to="/example"/>
    }
];

export default routes;
